  <ellipse id="wan_led" cx="62.759" cy="81.619" rx="2.80663" ry="1.57917" fill="#555" />
  <ellipse id="lan_led" cx="80.2352" cy="81.2018" rx="2.80663" ry="1.57917" fill="#555"/>
  <ellipse id="wlan_led" cx="98.0965" cy="81.5679" rx="2.80663" ry="1.57917" fill="#555"/>
 </g>
</svg>


<script>
    
    var off = "#999";
    var green = "#00FF00";
    var red = "#FF0000";
    var wlan = $("#wlan_led");
    var lan = $("#lan_led");
    var wan = $("#wan_led");
    var all = $([wlan, lan, wan]);

    var systemBoot = [
        { e: wan, p: { fill: green }, o: { duration: 1 } },
        { e: wan, p: { fill: green }, o: { duration: 999 } },
        
        { e: lan, p: { fill: green }, o: { duration: 1 } },
        { e: lan, p: { fill: green }, o: { duration: 999 } },

        { e: wlan, p: { fill: red }, o: { duration: 1 } },
        { e: wlan, p: { fill: red }, o: { duration: 999 } },

        { e: wan, p: { fill: off }, o: { duration: 1 } },
        { e: wan, p: { fill: off }, o: { duration: 999 } },
        { e: lan, p: { fill: off }, o: { duration: 1 } },
        { e: lan, p: { fill: off }, o: { duration:999 } },
        { e: wlan, p: { fill: off }, o: { duration: 1 } },
        { e: wlan, p: { fill: off }, o: { duration: 999 } }
    ];

    var koalaSafeBoot =[
        { e: wlan, p: { fill: red }, o: { duration: 1 } },
        { e: wlan, p: { fill: red }, o: { duration: 999 } },
        
        { e: lan, p: { fill: green }, o: { duration: 1 } },
        { e: lan, p: { fill: green }, o: { duration: 999 } },

        { e: wan, p: { fill: green }, o: { duration: 1 } },
        { e: wan, p: { fill: green }, o: { duration: 999 } },

        { e: wlan, p: { fill: off }, o: { duration: 1 } },
        { e: wlan, p: { fill: off }, o: { duration: 999 } },
        { e: lan, p: { fill: off }, o: { duration: 1 } },
        { e: lan, p: { fill: off }, o: { duration:999 } },
        { e: wan, p: { fill: off }, o: { duration: 1 } },
        { e: wan, p: { fill: off }, o: { duration: 999 } }
    ];

    var upgrading = [
        { e: wan, p: { fill: green }, o: { duration: 1 } },
        { e: wan, p: { fill: green }, o: { duration: 500 } },
        { e: wan, p: { fill: off }, o: { duration: 1 } },
        
        { e: lan, p: { fill: green }, o: { duration: 1 } },
        { e: lan, p: { fill: green }, o: { duration: 500 } },
        { e: lan, p: { fill: off }, o: { duration: 1 } },

        { e: wlan, p: { fill: red }, o: { duration: 1 } },
        { e: wlan, p: { fill: red }, o: { duration: 500 } },
        { e: wlan, p: { fill: off }, o: { duration: 1 } }
    ];

    var offline = [
        { e: wan, p: { fill: green }, o: { duration: 1 } },
        { e: lan, p: { fill: green }, o: { duration: 1, sequenceQueue:false } },
        { e: wlan, p: { fill: red }, o: { duration: 1, sequenceQueue:false}},
        { e: wan, p: { fill: green }, o: { duration: 500 } },
        { e: lan, p: { fill: green }, o: { duration: 500, sequenceQueue:false } },
        { e: wlan, p: { fill: red }, o: { duration: 500, sequenceQueue:false}},

        { e: wan, p: { fill: off }, o: { duration: 1  }},
        { e: lan, p: { fill: off }, o: { duration: 1, sequenceQueue:false } },
        { e: wlan, p: { fill: off }, o: { duration: 1, sequenceQueue:false}},
        { e: wan, p: { fill: off }, o: { duration: 500 } },
        { e: lan, p: { fill: off }, o: { duration: 500, sequenceQueue:false } },
        { e: wlan, p: { fill: off }, o: { duration: 500, sequenceQueue:false}}
    ];

    var normal = [
        { e: wan, p: { fill: green }, o: { duration: 50, complete: function(elements) {  $(elements).css({"fill": off}); } }},
        { e: lan, p: { fill: green }, o: { duration: 90, sequenceQueue:false, complete: function(elements) {  $(elements).css({"fill": off}); } }},
        { e: wlan, p: { fill: red }, o: { duration: 120, sequenceQueue:false, complete: function(elements) {  $(elements).css({"fill": off}); } }}
    ];

    var states = [
        {name:"firmware boot", cmd:function(){ 
            wan.css({"fill":green}); 
        }}, 
        {name:"system boot", sequence: systemBoot}, 
        {name:"KoalaSafe loading", sequence:koalaSafeBoot}, 
        {name:"normal", sequence:normal}, 
        {name:"offline", sequence:offline}, 
        {name:"upgrading", sequence:upgrading}
    ];

    function reset(){
        $.each(all, function(i, led){
            led.css({"fill":off});
            led.velocity("stop", true);
        })
    }

    function run(name, sequence){
        
        console.log("Running sequence " + name);
        var completed = [{ e: wan, p:{opacity: 1}, o: {complete: function(){
            console.log("Completed sequence " + name);
            run(name, sequence);
        }}}];

        // repeating is not smooth, so manually duplicate the sequence
        var actual = sequence;
        for (var i =0; i <5; i++){
            actual = actual.concat(actual);
        }
        $.Velocity.RunSequence(actual.concat(completed));
    }


    var options = $("#options");
    options.on('change', function() {
        var selected = $("option:selected", this);
        var name = selected.val();
        var state = states.find(function(x) { return x.name == name; });
        reset();
        if ("cmd" in state){
            state.cmd();
        }else{
            run(state.name, state.sequence);
        }
    });

    $.each(states, function() {
        options.append($("<option />").val(this.name).text(this.name));
    });

    var state = states[0];
    if ("cmd" in state){
        state.cmd();
    }else{
        run(state.name, state.sequence);
    }


</script>

</body>
